  return (
    <div>
      <Line  data={{
          labels: ['Red', 'Blue', 'Yellow', 'Green', 'Purple', 'Orange'],
          datasets: [
            {
              label: 'last 7 days ',
              data: [12, 19, 3, 5, 2, 3],
              backgroundColor: [
                'green'
              ],
              borderColor: [
                'green'
              ]
            },
          ],
        }}
     height={100} width={30} options={{maintainAspectRatio:false}} />
    </div>
  );
}
